import cv2
import numpy as np
import matplotlib.pyplot as plt

from google.colab import drive
drive.mount('/content/gdrive')

path = "/content/gdrive/MyDrive/mv/"

image = cv2.imread(path+"eye.pupil 1.jpg")
plt.imshow(image)
# Convert the image to grayscale
gray = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)

# Binarize the image using Otsu's thresholding
threshold, binarized = cv2.threshold(gray, 0, 255, cv2.THRESH_BINARY + cv2.THRESH_OTSU)

# Convert the image to an edge map using Canny edge detection
edges = cv2.Canny(binarized, 100, 200)

# Perform the circular Hough transform
#circles = cv2.HoughCircles(edges, cv2.HOUGH_GRADIENT, 1, 20, param1=50, param2=30, minRadius=0, maxRadius=0)
circles = cv2.HoughCircles(edges,cv2.HOUGH_GRADIENT,1,800,param1=30,param2=1,minRadius=0,maxRadius=0)

if circles is not None:
    circles = np.round(circles[0, :]).astype("int")
    for (x, y, r) in circles:
        cv2.circle(image, (x, y), r, (0, 255, 0), 4)

# Show the image
from google.colab.patches import cv2_imshow

im_rgb = cv2.cvtColor(image, cv2.COLOR_BGR2RGB)

cv2_imshow(im_rgb)
cv2.waitKey(0)
cv2.destroyAllWindows()



